BEGIN TRANSACTION;
DROP TABLE IF EXISTS "actor";
CREATE TABLE IF NOT EXISTS "actor" (
	"actor_id"	numeric NOT NULL,
	"first_name"	VARCHAR(45) NOT NULL,
	"last_name"	VARCHAR(45) NOT NULL,
	"last_update"	TIMESTAMP NOT NULL,
	PRIMARY KEY("actor_id")
);
DROP TABLE IF EXISTS "language";
CREATE TABLE IF NOT EXISTS "language" (
	"language_id"	SMALLINT NOT NULL,
	"name"	CHAR(20) NOT NULL,
	"last_update"	TIMESTAMP NOT NULL,
	PRIMARY KEY("language_id")
);
DROP TABLE IF EXISTS "category";
CREATE TABLE IF NOT EXISTS "category" (
	"category_id"	SMALLINT NOT NULL,
	"name"	VARCHAR(25) NOT NULL,
	"last_update"	TIMESTAMP NOT NULL,
	PRIMARY KEY("category_id")
);
DROP TABLE IF EXISTS "film";
CREATE TABLE IF NOT EXISTS "film" (
	"film_id"	int NOT NULL,
	"title"	VARCHAR(255) NOT NULL,
	"description"	BLOB SUB_TYPE TEXT DEFAULT NULL,
	"release_year"	VARCHAR(4) DEFAULT NULL,
	"language_id"	SMALLINT NOT NULL,
	"original_language_id"	SMALLINT DEFAULT NULL,
	"rental_duration"	SMALLINT NOT NULL DEFAULT 3,
	"rental_rate"	DECIMAL(4, 2) NOT NULL DEFAULT 4.99,
	"length"	SMALLINT DEFAULT NULL,
	"replacement_cost"	DECIMAL(5, 2) NOT NULL DEFAULT 19.99,
	"rating"	VARCHAR(10) DEFAULT 'G',
	"special_features"	VARCHAR(100) DEFAULT NULL,
	"last_update"	TIMESTAMP NOT NULL,
	CONSTRAINT "CHECK_special_features" CHECK("special_features" IS null OR "special_features" LIKE '%Trailers%' OR "special_features" LIKE '%Commentaries%' OR "special_features" LIKE '%Deleted Scenes%' OR "special_features" LIKE '%Behind the Scenes%'),
	CONSTRAINT "fk_film_language_original" FOREIGN KEY("original_language_id") REFERENCES "language"("language_id"),
	CONSTRAINT "fk_film_language" FOREIGN KEY("language_id") REFERENCES "language"("language_id"),
	PRIMARY KEY("film_id"),
	CONSTRAINT "CHECK_special_rating" CHECK("rating" IN ('G', 'PG', 'PG-13', 'R', 'NC-17'))
);
DROP TABLE IF EXISTS "film_actor";
CREATE TABLE IF NOT EXISTS "film_actor" (
	"actor_id"	INT NOT NULL,
	"film_id"	INT NOT NULL,
	"last_update"	TIMESTAMP NOT NULL,
	CONSTRAINT "fk_film_actor_film" FOREIGN KEY("film_id") REFERENCES "film"("film_id") ON DELETE NO ACTION ON UPDATE CASCADE,
	PRIMARY KEY("actor_id","film_id"),
	CONSTRAINT "fk_film_actor_actor" FOREIGN KEY("actor_id") REFERENCES "actor"("actor_id") ON DELETE NO ACTION ON UPDATE CASCADE
);
DROP TABLE IF EXISTS "film_category";
CREATE TABLE IF NOT EXISTS "film_category" (
	"film_id"	INT NOT NULL,
	"category_id"	SMALLINT NOT NULL,
	"last_update"	TIMESTAMP NOT NULL,
	PRIMARY KEY("film_id","category_id"),
	CONSTRAINT "fk_film_category_film" FOREIGN KEY("film_id") REFERENCES "film"("film_id") ON DELETE NO ACTION ON UPDATE CASCADE,
	CONSTRAINT "fk_film_category_category" FOREIGN KEY("category_id") REFERENCES "category"("category_id") ON DELETE NO ACTION ON UPDATE CASCADE
);
DROP INDEX IF EXISTS "idx_actor_last_name";
CREATE INDEX IF NOT EXISTS "idx_actor_last_name" ON "actor" (
	"last_name"
);
DROP INDEX IF EXISTS "idx_fk_language_id";
CREATE INDEX IF NOT EXISTS "idx_fk_language_id" ON "film" (
	"language_id"
);
DROP INDEX IF EXISTS "idx_fk_original_language_id";
CREATE INDEX IF NOT EXISTS "idx_fk_original_language_id" ON "film" (
	"original_language_id"
);
DROP INDEX IF EXISTS "idx_fk_film_actor_film";
CREATE INDEX IF NOT EXISTS "idx_fk_film_actor_film" ON "film_actor" (
	"film_id"
);
DROP INDEX IF EXISTS "idx_fk_film_actor_actor";
CREATE INDEX IF NOT EXISTS "idx_fk_film_actor_actor" ON "film_actor" (
	"actor_id"
);
DROP INDEX IF EXISTS "idx_fk_film_category_film";
CREATE INDEX IF NOT EXISTS "idx_fk_film_category_film" ON "film_category" (
	"film_id"
);
DROP INDEX IF EXISTS "idx_fk_film_category_category";
CREATE INDEX IF NOT EXISTS "idx_fk_film_category_category" ON "film_category" (
	"category_id"
);
DROP TRIGGER IF EXISTS "actor_trigger_ai";
CREATE TRIGGER actor_trigger_ai AFTER INSERT ON actor
 BEGIN
  UPDATE actor SET last_update = DATETIME('NOW')  WHERE rowid = new.rowid;
 END;
